import React from "react";
import Card from "./card";


const getnewcard = (contact) =>{

    return(
         <div>
       <Card name ={contact.name} img ={contact.imgURL} 
       phone= {contact.phone} email = {contact.email}/>
      
       </div>
    )

}

export default getnewcard
